script: |
  super -f text -I q1432.spq | sort > q1432.out

inputs:
  - name: q1432.spq
    data: |
      SELECT DISTINCT col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( - 81 * + col1 / + col0 + 59 * 10 + - col2 IN ( + col2 ) );
  - name: tab0

outputs:
  - name: q1432.out
    data: |
      10
      47
      99
